INSERT INTO `circles` VALUES (1,'立教大学硬式野球サークル Riyakyu','バスケ','@riyakyuyakyu','創部56年、東京六大学理工系硬式野球連盟に所属している大学公認の硬式野球サークルです！\r\n六大学で東京ドームの大会やリーグ戦、合宿等を行います。選手、マネージャー、練習試合相手大募集！！文系学部生も新座キャンパス生も、全学部生大歓迎！','miku_hug.jpg','2020-04-15 11:13:00','2020-04-22 04:53:49','東京大学','部活','sgsgs','agagqgrwgrgsg','gfgs','5',''),(3,'立教イーグルゴルフクラブ','バスケ','@rikkyo_eagle','立教大学公認のゴルフサークル、立教イーグルゴルフクラブです！ゴルフの経験者はもちろん、初心者の方も大歓迎！！一年を通して、入会・体験受け付けているので、気軽にDMお待ちしてます！','6adf0efb7bcf9d613a851626748d7e18.jpg','2020-04-15 21:41:05','2020-04-21 02:35:02','東京大学','インカレ','','','','',''),(4,'立教大学学園祭研究会SPF','文化系','＠welcomeSPF2020','学園祭研究会とは、立教大学池袋キャンパス学園祭(St. Paul’s Festival)の運営を行う団体です！30000人を超える来場者、100を超える団体、学園祭に関わる全ての人のために、全力を注ぎます。「想像以上を創造しよう」をモットーに、今しかできないこと、今だからできることを一緒に創りましょう！','Blue-hair-anime-girl-Hatsune-Miku-smile-cherry-blossoms_1920x1080.jpg','2020-04-15 21:42:22','2020-04-21 02:54:31','慶応義塾大学','オール学内','','','','',''),(5,'立教応援団','文化系','@rikkiosinkan','立教応援団は応援団、吹奏楽部から構成されており、本年度は「一”はじめ”をスローガンに掲げ、部員一同、より一層活動に励んでいます。体育会、東京六大学野球やアメフトの試合など、様々な場所で活躍できます。グラウンドや選手たちの間近で応援できるのは私たち応援団だけ！！','798034-circuits-cyan-interface.jpg','2020-04-15 21:42:59','2020-04-21 03:01:15','早稲田大学','オール学内','','','','',''),(6,'立教 Triumph','テニス','@Triumph__2020','立教で唯一の３N(会費なし、強制なし、お酒なし)のアットホームなサークルです??Triumphは初心者も多く、ゆるーく楽しくテニスしてます！??キャンプに合宿、楽しいこと盛りだくさん！気軽にDMください！','MTG.png','2020-04-15 21:43:40','2020-04-21 06:50:04','早稲田大学','オール学内','','','','',''),(7,'立教スカッシュラケットクラブ','文化系','@rikkyosquash_20','立教大学”唯一”のスカッシュサークルです！大学からスポーツを始めたいけどど、他の運動系サークルは敷居がたかそう…なんて感じてるアナタにおすすめ！！初心者ばかりなので、スポーツ経験関係なく楽しめます！1年通して楽しいイベントも盛りだくさん！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/oW4Mn1rMsIFJ7znq97MdwAFmvSY8sNClCMLBxjif.jpeg','2020-04-15 21:44:15','2020-04-15 21:44:15','法政大学','インカレ','','','','',''),(8,'立教ESS','文化系','＠rikkyoess_2020','立教３大サークルの一つ。立教大学公認サークルで、120年以上の歴史があります！会員数はなんと200人以上！\r\n英語が好きな人！イベントを楽しみたい人！友達たくさんつくりたい人！大学を謳歌したい人！ESSに集まれ～～！！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/CGHEJHuXHYSL70X4kvm0mE4R8IdsV1L12QFru1pv.jpeg','2020-04-15 21:44:47','2020-04-15 21:44:47','中央大学','オール学内','','','','',''),(9,'立教大学AIESEC','文化系','@AIESEC_StPauls','AIESEC(アイセック)は世界126の国と地域で70000人以上のメンバーが活動している世界最大級の学生団体です！平和で人々の可能性が最大限発揮された社会の実現を目指しています。英語力は重視していません。どんな人も、世界を変えられる可能性を秘めています！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/H0tmJPUPxTrnP1XZZGKzdB8AYNLnpnETtJuW2OzA.jpeg','2020-04-15 21:45:22','2020-04-15 21:45:22','法政大学','部活','','','','',''),(10,'立教大学軽音楽部RLMS','文化系','@rlms_shinkan','立教大学公認サークル！R＆B、FUNK、JAZZ、SOUL、POPS、FUSION、BLUESなど様々なジャンルの音楽をやっています。ライブは月に一度程度やります！ライブ以外にも楽しい活動盛りだくさん！兼サーも可能なので気軽に連絡ください！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/1Nnaw85okssljwz7VdYGuBGHiNqoD1y9OCRxWTel.jpeg','2020-04-15 21:45:55','2020-04-15 21:45:55','中央大学','オール学内','','','','',''),(11,'立教NSH','文化系','@nsh_2020','立教大学公認ビッグバンドサークル　New Swingin’ Herdです！経験の有無に関わらず初心者も大歓迎！未経験でも先輩が優しく教えてくれます！兼サーもOKなので気軽に来てください！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/CMWS1y9rFNvZ7wsRRS9ormd3uHU1u84jhrDHvz6q.jpeg','2020-04-15 21:46:43','2020-04-15 21:46:43','法政大学','インカレ','','','','',''),(12,'立教パイナップル硬式テニスサークル','テニス','@rikkyo_pine45th','今年45年目の立教大学公認サークルです！初心者も経験者も大歓迎！10団体に所属しており、テニスはもちろん、楽しい行事もたくさん！興味ある方はtwitterのリプライ、DMお待ちしてます！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/nwQAVPhUoxlENleVPHsXULK9kJnbX7CZs1xAfv5e.jpeg','2020-04-15 21:48:10','2020-04-15 21:48:10','中央大学','オール学内','','','','',''),(13,'立教大学探検部','文化系','@Rikkyotankenshi','今年で50周年の1969発足のサークル。無人島、廃墟、洞穴、ダム、アウトドアならなんでも行きます。学年・性別・国籍不問。新座も池袋も大歓迎！他の山岳系団体と比べて、ユルくてテキトーな感じ。','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/8JSXHf5yhJpfvHsdk50tZlU5ibxo7bwd6isj3EFn.jpeg','2020-04-15 21:48:44','2020-04-15 21:48:44','立教大学','部活','','','','',''),(14,'立教大学チアダンスチームLUMINAS','文化系','@luminas_rikkyo','USA regionals 2020 pom/large部門1位??pom/small部門5位??チアダンスは個性・協調性どちらも伸ばしてくれる競技！仲間を作って自分を奮い立たせ、観る人を沸かせよう！！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/gT5P6SRCux61YY0DeRTdh3rdhQC0aWfMGN50FTed.jpeg','2020-04-15 21:49:42','2020-04-15 21:49:42','東京大学','オール学内','','','','',''),(15,'立教ベリーダンスサークルLatees','文化系','＠BellyLatees','私たち立教ベリー出すサークルはダンスに興味ある女の子たちを大大大募集しています??毎週火・金曜日に活動中！先生が丁寧に教えてくれます！新しい踊りに挑戦してみたい人、素敵な衣装を来てみたい人、気軽に連絡お待ちしてます。新一年生だけでなく、在校生も大歓迎！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/fsCI0OE0JqWomhZsMM2aHvUh7muKqjTj2OsBihzz.jpeg','2020-04-15 21:50:16','2020-04-15 21:50:16','立教大学','インカレ','','','','',''),(16,'立教大学スペイン語会 La Sociedad de Espanol','語学国際','@RikkyoSpanish','立教大学で50年以上の歴史を誇る公認団体です！毎週月曜日の勉強会や、休日にスポーツ、合宿などの活動を行なっています。アットホームなサークルなので気軽に連絡お待ちしています。学年不問！','https://clelib.s3.ap-northeast-1.amazonaws.com/circle_thumbnail/Phs5K5uHM0GU0QrihlVuux6xY5lRNwvRQ0IjgD7x.jpeg','2020-04-15 21:50:54','2020-04-15 21:50:54','東京大学','オール学内','','','','','');
